import React from 'react';
import './App.css';

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Frankishtein'

        },
        {
          name: 'Dracuka'

        },
        {
          name: 'Zombie'

        }
      ]
    };
  }

  componentDidMount() {
    fetch("http://jsonplaceholder.typicode.com/users")
      .then(response => response.json())
      .then(data => this.setState({ monsters: data }));
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((item) => <h1 key={item.name}>{item.name}</h1>)
        }
      </div>
    )
  };
}

export default App;
